	public static Vector<ParkingBlock> GetParkingBlocks() {
		Vector<ParkingBlock> parkingBlocks = new Vector<ParkingBlock>();
		for (int i = 0; i < blocks.length; i++) {
			String blockString = blocks[i];
			String[] result = blockString.split(",");
			
			double meterLng = Double.parseDouble(result[1]);
			double meterLat = Double.parseDouble(result[2]);
			String meterAddress = result[3];
			double startLng = Double.parseDouble(result[4]);
			double startLat = Double.parseDouble(result[5]);
			double endLng = Double.parseDouble(result[6]);
			double endLat = Double.parseDouble(result[7]);
			
			LatLng meterLocation = new LatLng(meterLat,meterLng);
			LatLng startLocation = new LatLng(startLat,startLng);
			LatLng endLocation = new LatLng(endLat,endLng);
			ParkingBlock parkingBlock = new ParkingBlock(
					meterAddress, meterLocation, startLocation, endLocation);
			parkingBlocks.add(parkingBlock);
		}
		
		return parkingBlocks;
	}
